Account_Contact_Acco_5.query:
q = load "${App.Datasets.HLS_Task7_tp.FullyQualifiedName}";
q = filter q by 'CarePlan.IsClosed' == "false";
q = filter q by 'IsOverdue' == "true";
--q = filter q by 'DaysOverdue' >= -15 && 'DaysOverdue' <= -1;
q = group q by all;
q = foreach q generate unique('Id') as 'Id';
q = limit q 2000;

Breached_SLA_1.query:
q = load "${App.Datasets.HLS_Care_Request8_tp.FullyQualifiedName}";
q = filter q by date('DueDate_Year', 'DueDate_Month', 'DueDate_Day') in ["current day".."2 days ahead"];
q = filter q by 'Case.Status' != "Closed";
q = group q by all;
q = foreach q generate unique('Id') as 'count';
